import logo from "./logo.svg";
import "./App.css";
import { Slider } from "./launchPage";
import { Container, Row, Col } from "react-bootstrap";
function App() {
  return (
    <div className="App">
      <Container>
        <Row className="justify-content-md-center">
          <Col sm={3}>
            <Slider />
          </Col>
          <Col sm={3}></Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
